import React from "react";
import "./Navbar.css";
import Vector from "../../assets/icons/Vector.png";
import layout from "../../assets/icons/Vector.png";
import database from "../../assets/icons/Vector.png";
import settings from "../../assets/icons/Vector.png";
import logout from "../../assets/icons/Vector.png";

export default function Navbar() {
  return (
    <div>
      <div class="nav-wrapper">
        <div class="logo-name">
          <img src={Vector} />
          <h1>Pro Manage</h1>
        </div>
        <a class="submenu">
          <img src={layout} />
          <h1>Board</h1>
        </a>
        <a class="submenu">
          <img src={database} />
          <h1>Analytics</h1>
        </a>
        <a class="submenu">
          <img src={settings} />
          <h1>Settings</h1>
        </a>
        <a class="logout submenu">
          <img src={logout} />
          <h1>Logout</h1>
        </a>
      </div>
    </div>
  );
}


